import React from 'react';
import styled, { keyframes } from 'styled-components';
import { motion, AnimatePresence } from 'framer-motion';
import { FaTelegram, FaMedium } from 'react-icons/fa';
import { FaXTwitter } from 'react-icons/fa6';
import AnimatedBackground from './components/AnimatedBackground';

const AppContainer = styled.div`
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  color: white;
  padding: 2rem;
  position: relative;
`;

const float = keyframes`
  0% { transform: translateY(0); }
  50% { transform: translateY(-18px); }
  100% { transform: translateY(0); }
`;

const MascotAura = styled(motion.div)`
  position: absolute;
  top: 50%;
  left: 50%;
  width: 250px;
  height: 250px;
  background: radial-gradient(circle, rgba(255,215,0,0.35) 0%, rgba(255,215,0,0.18) 60%, rgba(26,26,64,0.0) 100%);
  transform: translate(-50%, -50%);
  border-radius: 50%;
  filter: blur(8px);
  z-index: 0;
  pointer-events: none;
`;

const MascotContainer = styled(motion.div)`
  width: 200px;
  height: 200px;
  margin: 2rem 0 1rem 0;
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
  animation: ${float} 4s ease-in-out infinite;
  z-index: 1;

  img {
    width: 100%;
    height: 100%;
    object-fit: contain;
    filter: drop-shadow(0 0 32px rgba(255, 215, 0, 0.4));
    z-index: 2;
    position: relative;
  }
`;

const MascotShadow = styled(motion.div)`
  position: absolute;
  bottom: -18px;
  left: 50%;
  transform: translateX(-50%);
  width: 90px;
  height: 18px;
  background: radial-gradient(ellipse at center, rgba(40,40,40,0.28) 0%, rgba(40,40,40,0.0) 80%);
  filter: blur(2px);
  z-index: 1;
`;

const ContentWrapper = styled(motion.div)`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100%;
  max-width: 800px;
`;

const Title = styled(motion.h1)`
  font-size: 3.5rem;
  margin-bottom: 2rem;
  background: linear-gradient(45deg, #FFD700, #FFA500);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
`;

const AddressContainer = styled(motion.div)`
  background: rgba(255, 255, 255, 0.05);
  padding: 2rem;
  border-radius: 15px;
  backdrop-filter: blur(10px);
  border: 1px solid rgba(255, 215, 0, 0.1);
  margin: 2rem 0;
  text-align: center;
  box-shadow: 0 8px 32px 0 rgba(31, 38, 135, 0.37);
  width: 100%;

  h2 {
    color: #FFD700;
    margin-bottom: 1rem;
    font-size: 1.5rem;
  }

  p {
    font-family: monospace;
    font-size: 1.2rem;
    background: rgba(255, 215, 0, 0.1);
    padding: 0.5rem;
    border-radius: 8px;
    display: inline-block;
  }
`;

const BuyButton = styled(motion.button)`
  padding: 1rem 3rem;
  font-size: 1.5rem;
  background: linear-gradient(45deg, #FFD700, #FFA500);
  border: none;
  border-radius: 30px;
  color: #1a1a1a;
  cursor: pointer;
  margin: 2rem 0;
  font-weight: bold;
  transition: transform 0.2s;
`;

const SocialButtons = styled.div`
  display: flex;
  gap: 2rem;
  margin: 2rem 0;
`;

const SocialButton = styled(motion.a)`
  font-size: 2.5rem;
  color: white;
  cursor: pointer;
  transition: color 0.3s;

  &:hover {
    color: #FFD700;
  }
`;

const Footer = styled(motion.div)`
  margin-top: auto;
  padding: 2rem;
  font-size: 1.2rem;
  text-align: center;
`;

function App() {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
        delayChildren: 0.3,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.5,
      },
    },
  };

  const mascotVariants = {
    initial: { scale: 0, rotate: -180 },
    animate: {
      scale: 1,
      rotate: 0,
      transition: {
        type: "spring",
        stiffness: 260,
        damping: 20,
      },
    },
    hover: {
      scale: 1.08,
      rotate: [0, -10, 10, -10, 0],
      transition: {
        duration: 0.7,
      },
    },
  };

  return (
    <>
      <AnimatedBackground />
      <AppContainer>
        <ContentWrapper
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <Title variants={itemVariants}>
            $JIGGIT
          </Title>

          <MascotContainer
            variants={mascotVariants}
            initial="initial"
            animate="animate"
            whileHover="hover"
          >
            <MascotAura layoutId="mascot-aura" />
            <img src="/assets/mascot.png" alt="Jiggit Mascot" />
            <MascotShadow layoutId="mascot-shadow" />
          </MascotContainer>

          <AddressContainer variants={itemVariants}>
            <h2>Token Address</h2>
            <p>0x123...789</p>
          </AddressContainer>

          <BuyButton
            variants={itemVariants}
            whileHover={{ scale: 1.05, boxShadow: '0 0 20px rgba(255, 215, 0, 0.5)' }}
            whileTap={{ scale: 0.95 }}
          >
            Buy $JIGGIT
          </BuyButton>

          <SocialButtons>
            {[
              { icon: <FaTelegram />, url: "https://t.me/jiggit" },
              { icon: <FaXTwitter />, url: "https://twitter.com/jiggit" },
              { icon: <FaMedium />, url: "https://medium.com/@jiggit" }
            ].map((social, index) => (
              <SocialButton
                key={index}
                as={motion.a}
                href={social.url}
                target="_blank"
                rel="noopener noreferrer"
                variants={itemVariants}
                whileHover={{ 
                  scale: 1.2, 
                  color: '#FFD700',
                  filter: 'drop-shadow(0 0 10px rgba(255, 215, 0, 0.5))'
                }}
                whileTap={{ scale: 0.9 }}
              >
                {social.icon}
              </SocialButton>
            ))}
          </SocialButtons>

          <Footer variants={itemVariants}>
            Join to our Jiggit nomad community
          </Footer>
        </ContentWrapper>
      </AppContainer>
    </>
  );
}

export default App;
